import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Grid from '@material-ui/core/Grid';
import Tela from '../components/Tela';

function Home(){
  const [telas, setTelas] = useState();
  const [marcada, setMarcada] = useState();

  useEffect(() => {
    axios.get("/telas")
      .then(res => { 
          setTelas(res.data)
      })
      .catch(erro => {
        console.error(erro)
      })
  },[]);

  const  recentTelasMarcada = ()=> {
    telas ? (telas.map(tela => <Tela key = {tela.telaId} tela = {tela}/>))
          : <p> Loading... </p>
  }

  return (
    <Grid container>
      <Grid item sm = {8} xs = {12}>
       {recentTelasMarcada}
      </Grid>
      <Grid item sm = {4} xs = {12}>
        <p> Perfil </p>
      </Grid>
    </Grid>
  )
};
export default Home;
